/**
 * @param {number[]} nums
 * @param {number} k
 * @param {number} dist
 * @return {number}
 */
var minimumCost = function(nums, k, dist) {
    const n = nums.length;
    const dp = Array.from({length: k}, () => Array(n).fill(Infinity));
    const sum = Array(n + 1).fill(0);

    for (let i = 0; i < n; i++) sum[i + 1] = sum[i] + nums[i];

    for (let i = 0; i < n; i++) dp[0][i] = nums[i];

    for (let parts = 1; parts < k; parts++) {
        for (let end = parts; end < n; end++) {
            for (let start = end - 1; start >= parts - 1 && end - start <= dist + 1; start--) {
                dp[parts][end] = Math.min(dp[parts][end], dp[parts - 1][start] + nums[end]);
            }
        }
    }

    let minCost = Infinity;
    for (let i = k - 1; i < n; i++) {
        if (n - i - 1 <= dist) {
            minCost = Math.min(minCost, dp[k - 1][i]);
        }
    }

    return minCost;
};
